import React, { useEffect, useState } from 'react';
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, Typography, IconButton, TextField, Box, Chip, MenuItem, Select, FormControl, InputLabel } from '@mui/material';

const AssignPathologiesDialog = ({ open, onClose, patient, onAssign }) => {
  const [allPathologies, setAllPathologies] = useState([]);
  const [assignedPathologies, setAssignedPathologies] = useState([]);
  const [selectedPathology, setSelectedPathology] = useState('');

  useEffect(() => {
    const fetchAllPathologies = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/pathologies', {
          method: 'GET',
          credentials: 'include',
        });
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setAllPathologies(data);
      } catch (error) {
        console.error('Error fetching all pathologies:', error);
      }
    };

    const fetchAssignedPathologies = async () => {
      try {
        const response = await fetch(`http://localhost:5000/api/patient_pathology/${patient.uuid}`, {
          method: 'GET',
          credentials: 'include',
        });
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setAssignedPathologies(data);
      } catch (error) {
        console.error('Error fetching assigned pathologies:', error);
      }
    };

    fetchAllPathologies();
    fetchAssignedPathologies();
  }, [patient]);

  const handleAddPathology = () => {
    if (selectedPathology && !assignedPathologies.some(pathology => pathology.id === selectedPathology.id)) {
      setAssignedPathologies([...assignedPathologies, selectedPathology]);
      setSelectedPathology('');
    }
  };

  const handleRemovePathology = (pathologyToRemove) => {
    setAssignedPathologies(assignedPathologies.filter(pathology => pathology.id !== pathologyToRemove.id));
  };

  const handleConfirm = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/patient_pathology', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({
          patient_uuid: patient.uuid,
          pathology_ids: assignedPathologies.map(pathology => pathology.id),
        }),
      });
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      onAssign();
      onClose();
    } catch (error) {
      console.error('Error assigning pathologies:', error);
    }
  };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Assegna Patologie a {patient.nominativo}</DialogTitle>
      <DialogContent>
        <Typography>Seleziona una o pi√π patologie da assegnare a questo paziente.</Typography>
        <FormControl fullWidth>
          <InputLabel>Patologie</InputLabel>
          <Select
            value={selectedPathology}
            onChange={(e) => setSelectedPathology(e.target.value)}
            renderValue={(selected) => selected.name}
          >
            {allPathologies.map((pathology) => (
              <MenuItem key={pathology.id} value={pathology} disabled={assignedPathologies.some(ap => ap.id === pathology.id)}>
                {pathology.name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <Button onClick={handleAddPathology} color="primary" disabled={!selectedPathology}>
          Aggiungi
        </Button>
        <Typography variant="h6" style={{ marginTop: '20px' }}>Patologie Assegnate</Typography>
        {assignedPathologies.map((pathology) => (
          <Box key={pathology.id} display="flex" alignItems="center">
            <Typography>{pathology.name}</Typography>
            <IconButton onClick={() => handleRemovePathology(pathology)}>
              <Typography color="secondary">RIMUOVI</Typography>
            </IconButton>
          </Box>
        ))}
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">Annulla</Button>
        <Button onClick={handleConfirm} color="primary">Conferma</Button>
      </DialogActions>
    </Dialog>
  );
};

export default AssignPathologiesDialog;
